I printed it as-is (upright) and it looked pretty good, even on my Solidoodle, which normally doesn't print ledges too well.&Acirc;&nbsp; I'm still working out the settings and configuration.&Acirc;&nbsp;<br />
It works perfectly with the brush from The Art of Shaving travel set (which is a great kit with no holder, I guess so you'll spend another $100 on the holder when you use it at home).<br />
OK, slight correction - they do sell $6 plastic brush stands along with the expensive ones, but they don't look as good as this one and they take up more room on the counter.&Acirc;&nbsp;
